import React, { useEffect, useState } from 'react';

function App() {
  const [schedulingData, setSchedulingData] = useState(null);

  useEffect(() => {
    fetch('/api/scheduling_decisions')
      .then(response => response.json())
      .then(data => setSchedulingData(data))
      .catch(error => console.error('Error fetching scheduling data:', error));
  }, []);

  if (!schedulingData) {
    return <div>Loading scheduling decisions...</div>;
  }

  return (
    <div>
      <h1>ML-Driven Scheduling Decisions</h1>
      <table border="1">
        <thead>
          <tr>
            <th>Task ID</th>
            <th>Assigned Node</th>
            <th>Estimated Energy (W)</th>
            <th>Estimated Temperature (Â°C)</th>
          </tr>
        </thead>
        <tbody>
          {schedulingData.map((item) => (
            <tr key={item.taskId}>
              <td>{item.taskId}</td>
              <td>{item.nodeId}</td>
              <td>{item.energy.toFixed(2)}</td>
              <td>{item.temperature.toFixed(2)}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default App;
